INSERT INTO tbpeliculas(nombrePelicula,fechaEstreno) VALUES (_titulo,_fechaEstreno);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_review` (IN `_titulo` VARCHAR(50), IN `_fechaEstreno` DATE, IN `_director` VARCHAR(50), IN `_actor` VARCHAR(50), IN `_review` VARCHAR(1000), IN `_binImagen` MEDIUMBLOB, IN `_nombreImagen` VARCHAR(50), IN `_tamanoImagen` INT(100))  BEGIN
